// SPDX-License-Identifier: MIT

/* 
NOTES FOR FUTURE DEVELOPMENT:
-> Create db's for contracts and factories?



*/
pragma solidity ^0.8.0;

contract Part {
    //address public DATABASE_CONTRACT; // its db contract
    //address public PRODUCT_FACTORY; //reference to its product factory

    uint public id;
    bool public deployed;
    uint printerId;
    
    enum State {Created, Stored, Deployed, ShippedToDepot, ShippedToField}
    
    
    struct Action {
        address operator; //the address of the operator making that action
        State state;
        

        int lon;    //Longitude of the action
        int lat;    //Latitude of the action

        uint timestamp;    //time of the action
        uint blockcNo;     // block when action is done    

    }
    Action[] public actions;

    modifier isDeployed {
        require(deployed, 
                "The part is already deployed, no furhter actions can be done"
                );
        _;
    }

    constructor (uint _id, int _lon, int _lat, uint _printerId) {
        id = _id;
        deployed = false;
        printerId = _printerId;

        Action memory creation;
        creation.operator = msg.sender;
        creation.state = State.Created;
        creation.lon = _lon;
        creation.lat = _lat;
        creation.timestamp = block.timestamp; //is it secure?
        creation.blockcNo = block.number; //Is it secure?

        actions.push(creation);

        /*
        Check for use of db's
        */
        //Database database = Database(DATABASE_CONTRACT);
        //database.storeProductReferences(this);
    }
    
    function addAction (State state, int lon, int lat, bool _deployed) public isDeployed {
        Action memory action;
        action.operator = msg.sender;
        action.state = state;
        deployed = _deployed;
        action.lon = lon;
        action.lat = lat;
        action.timestamp = block.timestamp;
        action.blockcNo = block.number;

        
        actions.push(action);
    }

    function deploy() public isDeployed {
        deployed = true;
    }

    function getState() public view returns (State) {
        return actions[actions.length-1].state;
    }

}
